import React from 'react';
import ReactDOM from 'react-dom';
import Cordwars from './Cordwars'
import Leaders from './Leaders'


// createElement function
function createElement(content, tag = 'div', properties = {}) {
  return React.createElement(tag, properties, content);
}

// createUnorderedList function
function createUnorderedList(list) {
  return React.createElement(
    'ul',
    null,
    list.map((item, index) =>
      React.createElement('li', {  index }, item)
    )
  );
}

// Example usages of the functions
const helloWorldDiv = createElement('Hello World');
const customTag = createElement('Hello World', 'h1', { className: 'greeting' });
const fruits = createUnorderedList(['apples', 'oranges', 'bananas']);

// Render the elements to the DOM
export default function App () {
  return (
    <div>
      <h1>My Favorite Codewarriors</h1>
      <Cordwars user="noLan"/>
    </div>,
  <div>
    {helloWorldDiv}
    {customTag}
    {fruits}
  </div>
);
}

